import React, { useState, useEffect } from 'react';
import axios from 'axios';
import GetTask from '../../views/GetOrder';

const Details = (props) => {

    const initialOrderState = {
        id: null,
        academic_level: "",
        order_status: "",
        payment_status: ""
    };

    const [currentTask, setCurrentTask] = useState(initialOrderState);
    const [message, setMessage] = useState("");

    const getOrder = id => {
        GetTask.get(id)
            .then(response => {
                setCurrentTask(response.data);
                console.log(response.data);
                console.log("hello")
            })
            .catch(e => {
                console.log(e);
            });
    };

    useEffect(() => {
        getOrder(props.match.params.id);
        console.log(props.match.params.id)
    });

    return (
        <div>
            <div>Details</div>
            <div>Academic level: </div>
            <div>deadline: </div>
        </div>
    )
}

export default Details
